import React from "react";
import {Button, Card, Col, Form, Table} from "react-bootstrap";
import axios from "axios";
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import {faSave, faUndo} from '@fortawesome/free-solid-svg-icons'

class ListRooms extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            rooms:[]
        };


    }

   componentDidMount() {
        axios.get("http://localhost:8080/getRoom")
            .then(response => response.data)
            .then((data) =>{
                this.setState({rooms: data});
            });
   }

    render() {
        return(
            <Card className="border border-dark bg-dark text-white">
                <Card.Header>Lista Pokoi</Card.Header>
                <Card.Body>
                    <Table border hover striped variant={"dark"}>
                        <thead>
                            <th>Nazwa</th>
                            <th>Cena za noc</th>
                            <th>Cena za 3 posiłki</th>
                            <th>Łurzka</th>
                            <th>Typ</th>
                            <th>Opis</th>
                        </thead>
                        <tbody>
                        {this.state.rooms.length === 0 ?
                            <tr align={"center"}>
                                <td colSpan={"6"}> Nie dodano jeszcze pokoii.</td>
                            </tr> :
                            this.state.books.map((room) => {
                                <tr key={room.name}>
                                    <td>{room.name}</td>
                                </tr>
                            })
                        }
                        </tbody>
                    </Table>
                </Card.Body>
            </Card>
        );
    }

}

export default ListRooms;
